import React from "react";
import { Link } from "react-router-dom";
import { useEffect } from "react";
import { useDispatch } from "react-redux";
import getRandomUserData from '../../apis/getRandomUserData'
import { setUserData } from "../../redux/actions/setUserData";
function Dashboard(){
    const dispatch=useDispatch();
    useEffect(()=>{
        const getData=async()=>{
            const data=await getRandomUserData()
            console.log(data)
            setUserData(dispatch,data)
        }
        getData();
    },[dispatch])

return(
<div>
    <h1>Fetched User Data Succesfully</h1>
    <Link to="/profile/view">View profile</Link>
</div>
)
}

export default Dashboard;
